import React from "react";

const Landing = () => {
  return (
    <section className='landing'>
      <div className='dark-overlay'>
        <div className='landing-inner'>
          <h1 className='x-large'>GUARDIAN</h1>
          <h4 className='subtitle'>Command and Control</h4>

          <p className='lead'>
            Create a GUARDIAN profile/portfolio, share posts and connect with
            other volunteers and responders.
          </p>
          <div className='buttons'>
            <a href='register.html' className='btn btn-primary'>
              Sign Up
            </a>
            <a href='login.html' className='btn btn-light'>
              Login
            </a>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Landing;
